    },
    {
      id: 1,
      name: compras,
      cost: $50,
    },
    {
      id: 1,
      name: compras,
      cost: $50,
    },
  ];

  return (
    <div className="alert alert-success">
      <span> Restante: $700</span>
    </div>
  );
};

export default ExpenseList;
